function Battery() //This is out of 255, but the math is wrong somewhere. Packets are identical though.
{
	let packet = [];
	packet[0] = 0x00;
	packet[1] = 0x00;
	packet[2] = 0x1F;
	packet[3] = 0x00;
	packet[4] = 0x00;
	packet[5] = 0x00;
	packet[6] = 0x02;
	packet[7] = 0x07;
	packet[8] = 0x80;

	packet[89] = CalculateCrc(packet);

	device.send_report(packet, 91);
	packet = device.get_report(packet, 91);

	let Battery = (packet[2]/255);

	return(Battery);
}

